public class InnerDataSourceDataSourceConfigurationFactory(Action<Humidifier.Kendra.DataSourceTypes.DataSourceConfiguration> factoryAction = null) : SubResourceFactory<Humidifier.Kendra.DataSourceTypes.DataSourceConfiguration>
{

    internal InnerDataSourceGoogleDriveConfigurationFactory GoogleDriveConfigurationFactory { get; set; }

    internal InnerDataSourceWebCrawlerConfigurationFactory WebCrawlerConfigurationFactory { get; set; }

    internal InnerDataSourceS3DataSourceConfigurationFactory S3ConfigurationFactory { get; set; }

    internal InnerDataSourceSalesforceConfigurationFactory SalesforceConfigurationFactory { get; set; }

    internal InnerDataSourceDatabaseConfigurationFactory DatabaseConfigurationFactory { get; set; }

    internal InnerDataSourceSharePointConfigurationFactory SharePointConfigurationFactory { get; set; }

    internal InnerDataSourceConfluenceConfigurationFactory ConfluenceConfigurationFactory { get; set; }

    internal InnerDataSourceWorkDocsConfigurationFactory WorkDocsConfigurationFactory { get; set; }

    internal InnerDataSourceOneDriveConfigurationFactory OneDriveConfigurationFactory { get; set; }

    internal InnerDataSourceServiceNowConfigurationFactory ServiceNowConfigurationFactory { get; set; }

    protected override Humidifier.Kendra.DataSourceTypes.DataSourceConfiguration Create()
    {
        var dataSourceConfigurationResult = CreateDataSourceConfiguration();
        factoryAction?.Invoke(dataSourceConfigurationResult);

        return dataSourceConfigurationResult;
    }

    private Humidifier.Kendra.DataSourceTypes.DataSourceConfiguration CreateDataSourceConfiguration()
    {
        var dataSourceConfigurationResult = new Humidifier.Kendra.DataSourceTypes.DataSourceConfiguration();

        return dataSourceConfigurationResult;
    }
    public override void CreateChildren(Humidifier.Kendra.DataSourceTypes.DataSourceConfiguration result)
    {
        base.CreateChildren(result);

        result.GoogleDriveConfiguration ??= GoogleDriveConfigurationFactory?.Build();
        result.WebCrawlerConfiguration ??= WebCrawlerConfigurationFactory?.Build();
        result.S3Configuration ??= S3ConfigurationFactory?.Build();
        result.SalesforceConfiguration ??= SalesforceConfigurationFactory?.Build();
        result.DatabaseConfiguration ??= DatabaseConfigurationFactory?.Build();
        result.SharePointConfiguration ??= SharePointConfigurationFactory?.Build();
        result.ConfluenceConfiguration ??= ConfluenceConfigurationFactory?.Build();
        result.WorkDocsConfiguration ??= WorkDocsConfigurationFactory?.Build();
        result.OneDriveConfiguration ??= OneDriveConfigurationFactory?.Build();
        result.ServiceNowConfiguration ??= ServiceNowConfigurationFactory?.Build();
    }

} // End Of Class

